import React from 'react';
import { View,Text, StyleSheet } from 'react-native';
import { PackageIcons } from './';

const Packages = () => {
    return (
        <View>
            <PackageIcons />
            <Text>sdgf</Text>
        </View>
    );
}

const styles = StyleSheet.create({})

export default Packages;
